import React from 'react';
import { BrowserRouter as Router, Route, Link} from 'react-router-dom';
import TargetList from './TargetList';
import SuppresionList from './SuppresionList';
import './Navbar.css';


function Navbar() {
    return (
        <Router className="Router">
             <Route className="Route" path = "/" component = {TargetList} exact></Route>
             <Link className="Route" to="/">Target List </Link>
             <Route className="Route" path = "/suppresionList" component = {SuppresionList} exact></Route>
             <Link className="Route" to="/suppresionList">SuppresionList </Link>    
       </Router>
    )
}

export default Navbar
